class Solution {

    /**
     * @param Integer[] $nums
     * @return Integer
     */
    function findMaximumLength($nums) {
        $total = count($nums);
        if ($total <= 1) return $total;

        $maxLen = 1;
        $currentLen = 1;

        for ($i = 1; $i < $total; $i++) {
            if ($nums[$i] >= $nums[$i - 1]) {
                $currentLen++;
                $maxLen = max($maxLen, $currentLen);
            } else {
                $currentLen = 1;
            }
        }

        return $maxLen === $total ? $maxLen : max($maxLen, 1);
    }
}
